	id: 'amf_setup',
	title: 'AMF project configuration'
};
export const metadata = {
  "unversionedId": "AMF/using-amf/amf_setup",
  "id": "AMF/using-amf/amf_setup",
  "isDocsHomePage": false,
  "title": "AMF project configuration",
  "description": "This tutorial covers installing all the tools you'll need to run AMF in your application.",
  "source": "@site/../docs/AMF/using-amf/project_configuration.mdx",
  "slug": "/AMF/using-amf/amf_setup",
