/* @jsx mdx */
import Tabs from '@theme/Tabs';
import TabItem from '@theme/TabItem';
export const toc = [{
  value: 'Add AMF to your dependencies',
  id: 'add-amf-to-your-dependencies',
  children: []
}, {
  value: 'Code setup',
  id: 'code-setup',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <p>{`This tutorial covers installing all the tools you'll need to run AMF in your application.`}</p>
    <p>{`Artifacts to use AMF can be obtained from:`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://repository-master.mulesoft.org/nexus/content/repositories/releases/com/github/amlorg/"
        }}>{`Maven`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://www.npmjs.com/package/amf-client-js"
        }}>{`NPM`}</a></li>
    </ul>
    <h2 {...{
      "id": "add-amf-to-your-dependencies"
    }}>{`Add AMF to your dependencies`}</h2>
    <p>{`First you need to add AMF to your project, whether in Gradle, Maven, or NPM.`}</p>


    <Tabs groupId="framework" defaultValue="gradle" values={[{
      label: 'Gradle',
      value: 'gradle'
    }, {
      label: 'Maven',
      value: 'maven'
    }, {
      label: 'NPM',
      value: 'npm'
    }]} mdxType="Tabs">
      <TabItem value="gradle" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-gradle"
          }}>{`// add mulesoft repository
repositories {
    maven {
        url 'https://repository-master.mulesoft.org/nexus/content/repositories/releases'
    }
}
dependencies {
    compile 'com.github.amlorg:amf-client_2.12:x.y.z'
}
`}</code></pre>
      </TabItem>
      <TabItem value="maven" mdxType="TabItem">
        <pre><code parentName="pre" {...{}}>{`<dependency>
    <groupId>com.github.amlorg</groupId>
    <artifactId>amf-client_2.12</artifactId>
    <version>x.y.z</version>
</dependency>
`}</code></pre>
      </TabItem>
      <TabItem value="npm" mdxType="TabItem">
        <p>{`NPM:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{`$ npm install --save amf-client-js
`}</code></pre>
        <p>{`Yarn:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{`$ yarn add --save amf-client-js
`}</code></pre>
      </TabItem>
    </Tabs>
    <p>{`NOTE: you may use the `}<inlineCode parentName="p">{`-SNAPSHOT`}</inlineCode>{` versions of the artifacts at your own risk since those snapshot versions may contain breaking changes.`}</p>
    <h2 {...{
      "id": "code-setup"
    }}>{`Code setup`}</h2>
    <p>{`To use AMF you must first initialize it like so:`}</p>
    <Tabs groupId="languages" defaultValue="java" values={[{
      label: 'Java',
      value: 'java'
    }, {
      label: 'JavaScript',
      value: 'js'
    }]} mdxType="Tabs">
      <TabItem value="java" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-java"
          }}>{`import amf.client.AMF;

class App {
    public static void main(String[] args){
      AMF.init().thenApply(() -> {
              // ... your code
      });
    }
}
`}</code></pre>
      </TabItem>
      <TabItem value="js" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-javascript"
          }}>{`const amf = require('./lib/amf-client-module.js')

await AMF.init();

// ... your code
`}</code></pre>
      </TabItem>
    </Tabs>
    <p>{`That's it! this is everything you need to start using AMF, in the following sections you can learn how to use every feature AMF has.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
